package com.rison.traffic.Application

import com.rison.traffic.util.{DateUtils, SparkUtils}
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.rdd.RDD
import org.apache.spark.{SparkConf, SparkContext}

/**
 * @author : Rison 2021/9/28 上午8:46
 *         5. 卡扣 ‘‘0001’’下所有的车辆轨迹
 */
object MonitorCarTrackApplication {
  def main(args: Array[String]): Unit = {
    val sparkConf = new SparkConf()
    sparkConf.setAppName(this.getClass.getSimpleName.stripSuffix("$"))
    SparkUtils.setMaster(sparkConf)
    val sc: SparkContext = SparkContext.getOrCreate(sparkConf)

    //获取当天全部的卡扣车流量数据
    val monitorCarFlowRDD: RDD[String] = sc.textFile("data/monitor_flow_action")
    monitorCarFlowRDD.cache()

    //过滤数据,只剩下卡扣‘‘0001’’数据
    val carIds: Array[String] = monitorCarFlowRDD
      .flatMap(_.split("\n"))
      .map(
        line => {
          val strings: Array[String] = line.split("\t")
          (strings(1), strings(3))
        }
      )
      .filter(_._1.equals("0001"))
      .map(_._2)
      .distinct()
      .collect()
    //定义广播变量，广播卡扣“0001”下的所有过车车牌
    val carIdsBroadCast: Broadcast[Array[String]] = sc.broadcast(carIds)
    //当天通过卡扣“0001”的车辆轨迹
    val carMonitorTrackRDD: RDD[(String, String)] = monitorCarFlowRDD
      .flatMap(_.split("\n"))
      .map(
        line => {
          val strings: Array[String] = line.split("\t")
          (strings(3), (strings(1), strings(4)))
        }
      )
      .filter(
        data => {
          carIdsBroadCast.value.contains(data._1)
        }
      )
      .groupByKey()
      .map(
        data => {
          val list: List[(String, String)] = data._2.toList.sortWith(
            (x, y) => {
              DateUtils.getTimeStringToLong(x._2) < DateUtils.getTimeStringToLong(y._2)
            }
          )
          (data._1, list.toStream.map(x => x._1).mkString("->"))
        }
      )
    monitorCarFlowRDD.unpersist()
    carMonitorTrackRDD.collect().foreach(println)
    sc.stop()
  }
}
